import {takeLatest, all, call} from 'redux-saga/effects';
import axios from 'axios';
import USER_ACTIONS_TYPES from '../user/user.types';

export function fetchUserFormToServer (data) {
    return axios(`http://localhost:2565/message`,{
        method: "post",
        data: data
    })
}


export function * signUp({payload}) {
   const res = yield call(fetchUserFormToServer,payload);
   yield console.log(res)
}



export function* onSignUpStart() {
    yield takeLatest(USER_ACTIONS_TYPES.SIGN_UP_START,signUp);
}
export function* userSagas() {
    yield all([
        call(onSignUpStart),
    ])
}
